--drop table user_log, purchase, "order", user_reg

create table user_reg (
  user_id bigint primary key
, reg_date timestamp not null
, customer_name text not null
, email text not null 
, tel text not null
, country text not null
)

create table "order" (
  order_id bigint primary key
, user_id bigint references "user_reg"(user_id)  
, art text not null
, shop text not null
, quantity int not null
, amount numeric (15, 2) not null 
, address_id text not null
) 

create table purchase (
  purchase_id bigint primary key
, order_id bigint references "order"(order_id)  
, payment_date timestamp not null
, card_number char(16) not null
, amount numeric (15, 2) not null
, status text not null check (status in ('fail', 'success'))
)

create table user_log (
  purchase_id bigint references purchase(purchase_id)  
, ip text not null
 )

